import React, { useState, useEffect } from "react";
import * as api from "../api/index.js"; // import all from api

const NumberPlate = () => {

    const [allPlates, setAllPlates] = useState([]);

    const getAllPlates = async () => {
        try {
            console.log("getAllPosts called");

            const { data } = await api.fetchPosts();

            console.log(data);

            data.sort((obj1, obj2) => obj2.createdAt - obj1.createdAt);

            setAllPlates(data);
        } catch (error) {
            console.log(error.message);
        }
    };

    useEffect(() => {
        getAllPlates();
    }, []);

    useEffect(() => {
        if(allPlates)
        {
            const arr = allPlates;
            arr.sort( (obj1, obj2) => (Date(obj2.createdAt) - Date(obj1.createdAt)) )
            setAllPlates(allPlates.sort);
        }
        
    }, [allPlates]);

    

    return (
        <div style={{ margin: "2rem" }}>
            <h3>List of Cars Parked</h3>
            <div>
                <ol>
                    <li>DL69</li>
                    <li>DL69</li>
                    <li>DL69</li>
                </ol>
            </div>
        </div>
    );
};

export default NumberPlate;
